:- module(gp_test,[run_test/1]).

run_test:-
    open('go-plus_trill_res.txt', write, S),
    foreach(q(C1,C2),test_q(C1,C2,S)),
    close(S).

test_q(C1,C2,S):-
    format("~a ~a~n", [C1, C2]),
    I is cputime,
    get_time(I2),
    (sub_class(C1,C2,_E,[max_expl(all),time_limit(60)])->
        (F is cputime,
         get_time(F2),
         T is F-I,
         T2 is F2-I2,
         format(S,"~a ~a | ~f ~f~n", [C1, C2, T, T2])
        );
        (format(S,"Error!~n",[]))
    ),
    flush_output(S).

